                <h3>This questionairre is designed to be completed alongside a clinician. For each of the following, select the scale that best represents the patient:</h3>
                <Question/>
            </ul>
        </main>
    )
}

function Question()
{
    const index = 1;
    const question = "Depressed Mood (sadness, hopeless, helpless, worthless)";
    const min = 0;
    const max = 100;

    return(
        <div>
            <h2>{index}. {question}</h2>
            <ul>
                <InputButton></InputButton>
            </ul>
        </div>
    )
}

function InputButton(){
    return(
        <div className = "buttonContainer">
            <button>0</button>
            <h4>These feeling states indicated only on questioning.</h4>
        </div>
    )
}
